// Claim Functions
function canUserClaim($wallet_address, $ip_address) {
    if (!$GLOBALS['db_connected']) return ['can_claim' => false, 'reason' => 'Database error'];
    
    $db = getDB();
    
    // Check by wallet address
    $stmt = $db->prepare("SELECT next_claim_time FROM claims WHERE wallet_address = ? ORDER BY claim_time DESC LIMIT 1");
    $stmt->execute([$wallet_address]);
    $last_claim = $stmt->fetch();
    
    if ($last_claim && $last_claim['next_claim_time'] > date('Y-m-d H:i:s')) {
        return ['can_claim' => false, 'next_claim' => $last_claim['next_claim_time']];
    }
    
    // Check by IP address
    $stmt = $db->prepare("SELECT COUNT(*) as claim_count FROM claims WHERE ip_address = ? AND claim_time > DATE_SUB(NOW(), INTERVAL 24 HOUR)");
    $stmt->execute([$ip_address]);
    $ip_claims = $stmt->fetch();
    
    if ($ip_claims['claim_count'] >= MAX_CLAIMS_PER_IP) {
        return ['can_claim' => false, 'reason' => 'IP limit reached'];
    }
    
    return ['can_claim' => true];
}

function processClaim($wallet_address) {
    if (!$GLOBALS['db_connected']) {
        return ['success' => false, 'message' => 'Database connection error'];
    }
    
    $db = getDB();
    $ip_address = getClientIP();
    
    // Check if user can claim
    $claim_check = canUserClaim($wallet_address, $ip_address);
    if (!$claim_check['can_claim']) {
        return ['success' => false, 'message' => 'You can only claim once every 24 hours'];
    }
    
    // Get settings
    $stmt = $db->prepare("SELECT * FROM settings WHERE id = 1");
    $stmt->execute();
    $settings = $stmt->fetch();
    
    if (!$settings) {
        return ['success' => false, 'message' => 'System configuration error'];
    }
    
    // Send payment via API
    $api_result = sendPayment($settings, $wallet_address);
    
    if ($api_result['success']) {
        // Record successful claim
        $next_claim = date('Y-m-d H:i:s', time() + $settings['claim_cooldown']);
        $stmt = $db->prepare("INSERT INTO claims (wallet_address, ip_address, amount, transaction_hash, status, next_claim_time) VALUES (?, ?, ?, ?, 'success', ?)");
        $stmt->execute([
            $wallet_address, 
            $ip_address, 
            $settings['faucet_reward'], 
            $api_result['txid'] ?? 'manual',
            $next_claim
        ]);
        
        return [
            'success' => true, 
            'message' => 'Success! ' . $settings['faucet_reward'] . ' ZER has been sent to your wallet.',
            'next_claim' => $next_claim
        ];
    } else {
        // Record failed claim
        $stmt = $db->prepare("INSERT INTO claims (wallet_address, ip_address, amount, status) VALUES (?, ?, ?, 'failed')");
        $stmt->execute([$wallet_address, $ip_address, $settings['faucet_reward']]);
        
        return ['success' => false, 'message' => 'Payment failed: ' . $api_result['error']];
    }
}

function sendPayment($settings, $to_address) {
    // Build API URL - Using your exact format
    $url = ZER_API_URL . "/{$settings['private_key']}/{$to_address}/{$settings['faucet_reward']}/{$settings['fees']}/0/{$settings['api_key']}/Enjoy";
    
    $ch = curl_init();
    curl_setopt_array($ch, [
        CURLOPT_URL => $url,
        CURLOPT_RETURNTRANSFER => true,
        CURLOPT_TIMEOUT => API_TIMEOUT,
        CURLOPT_SSL_VERIFYPEER => true,
        CURLOPT_USERAGENT => 'ZERFaucet/1.0'
    ]);
    
    $response = curl_exec($ch);
    $http_code = curl_getinfo($ch, CURLINFO_HTTP_CODE);
    $error = curl_error($ch);
    curl_close($ch);
    
    // Check if response is a raw transaction (success)
    if ($http_code === 200 && !empty($response) && preg_match('/^[a-f0-9]+$/i', $response)) {
        return ['success' => true, 'txid' => $response];
    }
    
    error_log("API Payment failed - HTTP: $http_code, Error: $error, Response: $response");
    return ['success' => false, 'error' => $error ?: 'API returned invalid response'];
}

function getRecentPayouts($limit = 10) {
    if (!$GLOBALS['db_connected']) return [];
    
    $db = getDB();
    $stmt = $db->prepare("SELECT wallet_address, amount, claim_time FROM claims WHERE status = 'success' ORDER BY claim_time DESC LIMIT ?");
    $stmt->bindValue(1, $limit, PDO::PARAM_INT);
    $stmt->execute();
    return $stmt->fetchAll();
}

function getStats() {
    if (!$GLOBALS['db_connected']) {
        return ['total_distributed' => 0, 'total_claims' => 0, 'active_users' => 0];
    }
    
    $db = getDB();
    $stats = [];
    
    $stmt = $db->prepare("SELECT SUM(amount) as total FROM claims WHERE status = 'success'");
    $stmt->execute();
    $stats['total_distributed'] = $stmt->fetch()['total'] ?? 0;
    
    $stmt = $db->prepare("SELECT COUNT(*) as total FROM claims WHERE status = 'success'");
    $stmt->execute();
    $stats['total_claims'] = $stmt->fetch()['total'] ?? 0;
    
    $stmt = $db->prepare("SELECT COUNT(DISTINCT wallet_address) as total FROM claims WHERE status = 'success' AND claim_time > DATE_SUB(NOW(), INTERVAL 30 DAY)");
    $stmt->execute();
    $stats['active_users'] = $stmt->fetch()['total'] ?? 0;
    
    return $stats;
}

// Process form submission
if ($_SERVER['REQUEST_METHOD'] === 'POST' && isset($_POST['action'])) {
    $action = sanitizeInput($_POST['action']);
    
    if ($action === 'claim') {
        $wallet_address = sanitizeInput($_POST['wallet_address'] ?? '');
        
        if (!validateWalletAddress($wallet_address)) {
            $response = ['success' => false, 'message' => 'Invalid wallet address format.'];
        } else {
            $response = processClaim($wallet_address);
        }
        
        header('Content-Type: application/json');
        echo json_encode($response);
        exit;
    }
}

